import React, { useState, useEffect, useRef } from 'react';
import {
  View,
  Text,
  StyleSheet,
  FlatList,
  TouchableOpacity,
  Alert,
  Dimensions,
  SafeAreaView,
} from 'react-native';
import MapView, { Marker, Polyline } from 'react-native-maps';
import AsyncStorage from '@react-native-async-storage/async-storage';

const { width, height } = Dimensions.get('window');

const HistoryScreen = () => {
  const [savedRoutes, setSavedRoutes] = useState([]);
  const [selectedRoute, setSelectedRoute] = useState(null);
  const [showMap, setShowMap] = useState(false);
  const mapRef = useRef(null);

  useEffect(() => {
    loadSavedRoutes();
  }, []);

  const loadSavedRoutes = async () => {
    try {
      const routes = await AsyncStorage.getItem('saved_routes');
      if (routes) {
        const parsedRoutes = JSON.parse(routes);
        setSavedRoutes(parsedRoutes.reverse()); // Show newest first
      }
    } catch (error) {
      console.error('Error loading routes:', error);
      Alert.alert('Error', 'Failed to load saved routes.');
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString() + ' ' + date.toLocaleTimeString();
  };

  const calculateDistance = (locations) => {
    if (locations.length < 2) return '0 km';

    let totalDistance = 0;
    for (let i = 1; i < locations.length; i++) {
      const prev = locations[i - 1];
      const curr = locations[i];
      const distance = calculateDistanceBetweenPoints(
        prev.latitude,
        prev.longitude,
        curr.latitude,
        curr.longitude
      );
      totalDistance += distance;
    }
    return `${(totalDistance / 1000).toFixed(2)} km`;
  };

  const calculateDistanceBetweenPoints = (lat1, lon1, lat2, lon2) => {
    const R = 6371e3; // Earth's radius in meters
    const φ1 = lat1 * Math.PI / 180;
    const φ2 = lat2 * Math.PI / 180;
    const Δφ = (lat2 - lat1) * Math.PI / 180;
    const Δλ = (lon2 - lon1) * Math.PI / 180;

    const a = Math.sin(Δφ/2) * Math.sin(Δφ/2) +
              Math.cos(φ1) * Math.cos(φ2) *
              Math.sin(Δλ/2) * Math.sin(Δλ/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));

    return R * c;
  };

  const calculateDuration = (startTime, endTime) => {
    const start = new Date(startTime);
    const end = new Date(endTime);
    const duration = end - start;
    const hours = Math.floor(duration / (1000 * 60 * 60));
    const minutes = Math.floor((duration % (1000 * 60 * 60)) / (1000 * 60));
    return `${hours}h ${minutes}m`;
  };

  const viewRoute = (route) => {
    setSelectedRoute(route);
    setShowMap(true);

    // Center map on the route
    if (mapRef.current && route.locations.length > 0) {
      const firstLocation = route.locations[0];
      mapRef.current.animateToRegion({
        latitude: firstLocation.latitude,
        longitude: firstLocation.longitude,
        latitudeDelta: 0.01,
        longitudeDelta: 0.01,
      });
    }
  };

  const deleteRoute = async (routeId) => {
    Alert.alert(
      'Delete Route',
      'Are you sure you want to delete this route?',
      [
        { text: 'Cancel', style: 'cancel' },
        {
          text: 'Delete',
          style: 'destructive',
          onPress: async () => {
            try {
              const updatedRoutes = savedRoutes.filter(route => route.id !== routeId);
              await AsyncStorage.setItem('saved_routes', JSON.stringify(updatedRoutes));
              setSavedRoutes(updatedRoutes);
              if (selectedRoute && selectedRoute.id === routeId) {
                setSelectedRoute(null);
                setShowMap(false);
              }
            } catch (error) {
              console.error('Error deleting route:', error);
              Alert.alert('Error', 'Failed to delete route.');
            }
          },
        },
      ]
    );
  };

  const renderRouteItem = ({ item }) => (
    <View style={styles.routeItem}>
      <View style={styles.routeHeader}>
        <Text style={styles.routeDate}>{formatDate(item.start_time)}</Text>
        <TouchableOpacity
          style={styles.deleteButton}
          onPress={() => deleteRoute(item.id)}
        >
          <Text style={styles.deleteButtonText}>×</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.routeInfo}>
        <Text style={styles.routeStats}>
          Distance: {calculateDistance(item.locations)}
        </Text>
        <Text style={styles.routeStats}>
          Duration: {calculateDuration(item.start_time, item.end_time)}
        </Text>
        <Text style={styles.routeStats}>
          Points: {item.locations.length}
        </Text>
      </View>

      <TouchableOpacity
        style={styles.viewButton}
        onPress={() => viewRoute(item)}
      >
        <Text style={styles.viewButtonText}>View Route</Text>
      </TouchableOpacity>
    </View>
  );

  if (showMap && selectedRoute) {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.mapContainer}>
          <MapView
            ref={mapRef}
            style={styles.map}
            initialRegion={{
              latitude: selectedRoute.locations[0]?.latitude || 37.78825,
              longitude: selectedRoute.locations[0]?.longitude || -122.4324,
              latitudeDelta: 0.01,
              longitudeDelta: 0.01,
            }}
          >
            {selectedRoute.locations.length > 0 && (
              <Marker
                coordinate={selectedRoute.locations[0]}
                title="Start"
                pinColor="green"
              />
            )}

            {selectedRoute.locations.length > 0 && (
              <Marker
                coordinate={selectedRoute.locations[selectedRoute.locations.length - 1]}
                title="End"
                pinColor="red"
              />
            )}

            <Polyline
              coordinates={selectedRoute.locations}
              strokeColor="#FF0000"
              strokeWidth={3}
            />
          </MapView>
        </View>

        <View style={styles.mapControls}>
          <TouchableOpacity
            style={styles.backButton}
            onPress={() => setShowMap(false)}
          >
            <Text style={styles.backButtonText}>← Back to List</Text>
          </TouchableOpacity>
        </View>
      </SafeAreaView>
    );
  }

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.headerTitle}>Saved Routes</Text>
        <Text style={styles.headerSubtitle}>
          {savedRoutes.length} route{savedRoutes.length !== 1 ? 's' : ''} saved
        </Text>
      </View>

      {savedRoutes.length === 0 ? (
        <View style={styles.emptyContainer}>
          <Text style={styles.emptyText}>No saved routes yet</Text>
          <Text style={styles.emptySubtext}>
            Start tracking a route to see it here
          </Text>
        </View>
      ) : (
        <FlatList
          data={savedRoutes}
          renderItem={renderRouteItem}
          keyExtractor={(item) => item.id}
          contentContainerStyle={styles.listContainer}
          showsVerticalScrollIndicator={false}
        />
      )}
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f5f5',
  },
  header: {
    backgroundColor: '#2196F3',
    padding: 20,
    paddingTop: 10,
  },
  headerTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#fff',
  },
  headerSubtitle: {
    fontSize: 16,
    color: '#E3F2FD',
    marginTop: 5,
  },
  listContainer: {
    padding: 15,
  },
  routeItem: {
    backgroundColor: '#fff',
    borderRadius: 12,
    padding: 15,
    marginBottom: 15,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.1,
    shadowRadius: 3,
    elevation: 3,
  },
  routeHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 10,
  },
  routeDate: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#333',
  },
  deleteButton: {
    width: 30,
    height: 30,
    borderRadius: 15,
    backgroundColor: '#F44336',
    alignItems: 'center',
    justifyContent: 'center',
  },
  deleteButtonText: {
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
  },
  routeInfo: {
    marginBottom: 15,
  },
  routeStats: {
    fontSize: 14,
    color: '#666',
    marginBottom: 3,
  },
  viewButton: {
    backgroundColor: '#2196F3',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 25,
    alignItems: 'center',
  },
  viewButtonText: {
    color: '#fff',
    fontSize: 16,
    fontWeight: 'bold',
  },
  emptyContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    padding: 40,
  },
  emptyText: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#666',
    marginBottom: 10,
  },
  emptySubtext: {
    fontSize: 16,
    color: '#999',
    textAlign: 'center',
  },
  mapContainer: {
    flex: 1,
  },
  map: {
    width: width,
    height: height * 0.8,
  },
  mapControls: {
    backgroundColor: '#fff',
    padding: 20,
    borderTopLeftRadius: 20,
    borderTopRightRadius: 20,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: -2,
    },
    shadowOpacity: 0.1,
    shadowRadius: 3,
    elevation: 5,
  },
  backButton: {
    backgroundColor: '#2196F3',
    paddingVertical: 15,
    paddingHorizontal: 30,
    borderRadius: 25,
    alignItems: 'center',
  },
  backButtonText: {
    color: '#fff',
    fontSize: 16,
    fontWeight: 'bold',
  },
});

export default HistoryScreen;
